import requests# 引用 requests 套件
from bs4 import BeautifulSoup as bs# 引用 Beautiful Soup 套件並縮寫為 bs
import pandas as pd# 引用套件並縮寫為 pd
import re# 引用套件 re
url ='https://scweb.cwb.gov.tw/Page.aspx?ItemId=20&loc=tw&adv=1'# 地震中心網址

c1 = pd.Series()# 宣告 mails 為一維的欄位
c2 = pd.Series()# 宣告 mails 為一維的欄位
c3 = pd.Series()# 宣告 mails 為一維的欄位
c4 = pd.Series()# 宣告 mails 為一維的欄位
c5 = pd.Series()# 宣告 mails 為一維的欄位
c6 = pd.Series()# 宣告 mails 為一維的欄位
c7 = pd.Series()# 宣告 mails 為一維的欄位
y = []
mon = []    
d = []# 宣告 add 為 list
h = []# 宣告 add 為 list
m = []# 宣告 add 為 list

year =[]
month =[]
mstr = ['01','02','03','04','05','06','07','08','09','10','11','12',]

year_b = int(input("請輸入起始年份(西元年)\n"))
mon_b = int(input("請輸入起始月份\n"))
year_e = int(input("請輸入結束年份(西元年)\n"))
mon_e = int(input("請輸入結束月份\n"))
 
period = 0
if mon_e <= mon_b:
    mon_e = mon_e + 12
    period = -12
if mon_e >= mon_b:
    period = period + (year_e - year_b)*12 + mon_e - mon_b + 1
    for mm in range(period):
        ms = mm + mon_b - 1
        
        ys = year_b
        while ms >= 12:
            ms = ms - 12
            ys += 1
        month.append(mstr[ms])
        year.append(str(ys))


for q in range(len(month)):
    

    formdata={# POST 需要的 data
        "__VIEWSTATE":"",
        "__VIEWSTATEGENERATOR": "3989C74E" ,       
        "__VIEWSTATEENCRYPTED": "", 
        "__EVENTVALIDATION": "",
        "ctl03$ddlYear": year[q] ,
        "ctl03$ddlMonth": month[q] ,
        "ctl03$btnSearch": "送出"}
    
    res = requests.post(url,data=formdata)# 使用 POST 方式取得網頁，並給予需要的 data

    soup = bs(res.text,'html.parser')# 以 Beautiful Soup 解析 HTML 程式碼

    

    k=0
    for j in soup.find_all('a'):# 找到網頁中 tag a 包含的區塊
        if j.text[0:1]=='小' or j.text[0:1]=='第':
            non=k
            break
    
        k+=1          
        i=1-k          
    for j in soup.find_all('a'):# 找到網頁中 tag a 包含的區塊
        if j.text[0:1]=='小' or j.text[0:1]=='第':
            c1 = c1.append(pd.Series([j.text])).reset_index(drop=True)# 將找到的資料中的字串部分加入
            y.append(int(year[q]))# 將找到的資料中的字串部分加入
        
        if i>=0 and i%7==2:
            c2 = c2.append(pd.Series([j.text])).reset_index(drop=True)# 將找到的資料中的字串部分加入
            #mon.append(int(month[q]))# 將找到的資料中的字串部分加入
        
        if i>=0 and i%7==3:
            c3 = c3.append(pd.Series([j.text])).reset_index(drop=True)# 將找到的資料中的字串部分加入
        
        if i>=0 and i%7==4:
            c4 = c4.append(pd.Series([j.text])).reset_index(drop=True)# 將找到的資料中的字串部分加入
        
        if i>=0 and i%7==5:
            c5 = c5.append(pd.Series([j.text])).reset_index(drop=True)# 將找到的資料中的字串部分加入
        
        if i>=0 and i%7==6:
            c6 = c6.append(pd.Series([j.text])).reset_index(drop=True)# 將找到的資料中的字串部分加入
        
        #if i>=0 and i%7==0 and j.text != "":
            #c7 = c7.append(pd.Series([j.text])).reset_index(drop=True)# 將找到的資料中的字串部分加入
        
        i+=1
    
for j in c2:# 找到網頁中 tag a 包含的區塊
    r = re.sub('[^0-9]+',' ', j)# 整理取得的資料，只保留全形數字與中文字
    s = re.split(r' ',r)
    
    mon.append(int(s[0]))
    d.append(int(s[1]))
    h.append(int(s[2]))
    m.append(int(s[3]))
    
#print(c2)
#df = pd.DataFrame({'地震編號':c1,'臺灣時間':c2,'經度':c3,'緯度':c4,'規模':c5,'深度':c6,'震央位置':c7})# 使用 dataframe 將姓名與信箱畫成表格
#print(df[['地震編號','臺灣時間','經度','緯度','規模','深度','震央位置']])# 印出表格
dict_2 = {"1.年":y,"2.月":mon,"3.日":d,"4.時":h,"5.分":m,"6.經度":c3,"7.緯度":c4,"8.規模":c5,"9.深度":c6}
df_2 = pd.DataFrame(dict_2)# 使用 dataframe 將姓名與信箱畫成表格
print(df_2)# 印出表格
#[['年','月','日','時','分','經度','緯度','規模','深度']]
     

xls_path = "F14041088.xlsx"
writer = pd.ExcelWriter(xls_path)
df_2.to_excel(writer,'Sheet1')
writer.save()
print('\nDataFrame.xlsx 存檔完畢 ! ')
